import { API_ULR, KEY } from "./config";
import { AJX } from "./hepler";

export const state = {
  recipe: {},
  search: {
    resutls: [],
    query: "",
    searchPage: 10,
    page: 1,
  },
  bookmarks: [],
};
const createRecipeObject = function (data) {
  const { recipe } = data.data;
  return {
    id: recipe.id,
    servings: recipe.servings,
    image: recipe.image_url,
    sourceUrl: recipe.source_url,
    title: recipe.title,
    ingredients: recipe.ingredients,
    publisher: recipe.publisher,
    cookingTime: recipe.cooking_time,
  };
};
export const loadRecipe = async function (id) {
  try {
    const data = await AJX(`${API_ULR}${id}`);
    state.recipe = createRecipeObject(data);
    console.log(state.recipe);
    if (state.bookmarks.some((rec) => rec.id === id))
      state.recipe.bookmarked = true;
    else state.recipe.bookmarked = false;
  } catch (err) {
    throw err;
  }
};

export const searchRecipe = async function (query) {
  state.search.query = query;
  const data = await AJX(`${API_ULR}?search=${query}`);
  state.search.resutls = data.data.recipes.map((recipe) => {
    return {
      image: recipe.image_url,
      id: recipe.id,
      publisher: recipe.publisher,
      title: recipe.title,
    };
  });
};

export const searchPagination = function (page = state.search.page) {
  state.search.page = page;
  const start = (page - 1) * state.search.searchPage;
  const end = page * state.search.searchPage;
  return state.search.resutls.slice(start, end);
};

export const updateServings = function (newServings) {
  state.recipe.ingredients.map(
    (ing) =>
      (ing.quantity = (ing.quantity * newServings) / state.recipe.servings)
  );
  state.recipe.servings = newServings;
  return state.recipe.servings;
};
const prisitBookmark = function () {
  localStorage.setItem("bookmark", JSON.stringify(state.bookmarks));
};
export const addBookmarkRecipe = function (recipe) {
  state.bookmarks.push(recipe);
  if (recipe.id === state.recipe.id) state.recipe.bookmarked = true;
  prisitBookmark();
};
export const removeBookmarkRecipe = function (id) {
  const index = state.bookmarks.findIndex((rec) => rec.id === id);
  state.bookmarks.splice(index, 1);
  if (id === state.recipe.id) state.recipe.bookmarked = false;
  prisitBookmark();
};

const init = function () {
  const loca = JSON.parse(localStorage.getItem("bookmark"));
  if (loca) state.bookmarks = loca;
};
init();
console.log(state.bookmarks);

export const addRecipeNew = async function (recipe) {
  try {
    const ingredients = Object.entries(recipe)
      .filter((entry) => entry[0].startsWith("ingredient") && entry[1] !== "")
      .map((ing) => {
        const ingArr = ing[1].replaceAll(" ", "").split(",");
        const [quantity, unit, description] = ingArr;
        return { quantity: quantity ? +quantity : null, unit, description };
      });
    console.log(ingredients, recipe);
    const newRecipe = {
      image_url: recipe.image,
      source_url: recipe.sourceUrl,
      title: recipe.title,
      servings: recipe.servings,
      cooking_time: recipe.cookingTime,
      publisher: recipe.publisher,
      ingredients,
    };
    const data = await AJX(`${API_ULR}?key=${KEY}`, newRecipe);
    state.recipe = createRecipeObject(data);
    console.log("0", state.recipe);
    addBookmarkRecipe(state.recipe);

    console.log(data);
  } catch (err) {
    throw err;
  }
};
